import { Button, Stack } from "react-bootstrap";
import  Container from "react-bootstrap/Container";
import BudgetCard from "./components/BudgetCard";

function App() {
  return (
    <Container className="my_4">
      <Stack direction="horizontal" gap="2" className="mb-4">
        <h1 className="me-auto">Presupuesto</h1>
        <Button variant="primary">Agregar presupuesto</Button>
        <Button variant="outline-primary">Agregar gasto</Button>
      </Stack>
      <div style={{
        display: "grid", 
        gridTemplateColumns: "repeat(auto-fill, minmax(3000px, 1fr))",
        gap: "1rem",
        alignItems: "flex-start",

        }}
      >
        <BudgetCard name="Entertainment" amount={200} max={1000}></BudgetCard>
      </div>
    </Container>
  );
}

export default App;
